export const bcs = require("../assets/icons/apple_book.png");
export const bank = require("../assets/icons/bank.png");
export const board = require("../assets/icons/board.png");
export const glob = require("../assets/icons/glob.png");
export const light = require("../assets/icons/light.png");
export const tech = require("../assets/icons/tech.png");
export const biome = require("../assets/icons/biome.png");
export const drawericon = require("../assets/icons/drawericon.png");
export const bcstest = require("../assets/icons/bcstest.png");
export const bdbank = require("../assets/icons/bdbank.png");
export const combine = require("../assets/icons/combine.png");
export const privatebank = require("../assets/icons/privatebank.png");
export const random = require("../assets/icons/random.png");
export const resultbg = require("../assets/icons/resultbg.png");
export default {
    bcs,
    bank,
    board,
    glob,
    light,
    tech,
    biome,
    drawericon,
    bcstest,
    bdbank,
    combine,
    privatebank,
    random,
    resultbg
}
